import React from 'react';
import UserList from '../components/UserList';
import HoaxifySection from '../components/HoaxifySection';
const HomePage = () => {
    return (
        <div className='container mt-3'>
            <div className='row'>
                <div className='col-sm'>
                    <HoaxifySection />
                </div>
                <div className='col-sm'>
                    <UserList />
                </div>

            </div>
        </div>
    );
};

export default HomePage;
